description:
Category	Feature, Parody / Spoof

Director	Jordan Septo
Starring	Chanel Preston, Kendall Karson, Evan Stone, Derrick Pierce, Maddy O'Reilly, Tommy Pistol, Ryan McLane, Natasha Starr

Money, Family, Sex!

The world famous Robertson Clan is undoubtedly America's favorite bunch of Red Necks. With their own brand of Southern Charm and Quirky sense of humor, they work together day in and day out at the family's multi-million dollar duck call empire. But when their work is done the real adventures start. These good old Louisiana boys heat up the bayou like no others.


